<style>

	/* INNER ORBIT GROUP */
	#innerOrbitGroup {
		animation: rotateOrbit 20s;
		animation-timing-function: linear;
		animation-iteration-count: infinite;
		animation-delay: 0s;
	}
	#innerOrbitGroup:hover {
		animation-play-state: paused;
	}
	#earthComponents {
		cursor: pointer;
		/* transition: 300ms; */
		animation-name: floating;
		animation-duration: 6s;
		animation-iteration-count: infinite;
		animation-timing-function: ease-in-out;
		fill: radial-gradient(circle at 1px 1px, #5cabff, #000);
	}
    /* Still need icon to pause it's animation on hover */
    #earthComponents:hover {
        animation-play-state: paused;
    }
    #aboutIconFrame{
        animation: rotateIcon 20s;
        animation-iteration-count: infinite;
        animation-timing-function: linear;
        stroke:white;
    }
    #aboutIconFrame:hover{
        animation-play-state:paused;
    }


	/* MIDDLE ORBIT GROUP */
	#middleOrbitGroup {
		animation: rotateOrbit 40s;
		animation-timing-function: linear;
		animation-iteration-count: infinite;
		animation-delay: 0s;
	}
	#middleOrbitGroup:hover {
		animation-play-state: paused;
	}
	#saturn {
		cursor: pointer;
		/* transition: 300ms; */
		animation-name: floating;
		animation-duration: 6s;
		animation-iteration-count: infinite;
		animation-timing-function: ease-in-out;
	}

	/* OUTER ORBIT GROUP */
	#outerOrbitGroup {
		animation: rotateOrbit 60s;
		animation-timing-function: linear;
		animation-iteration-count: infinite;
		animation-delay: 0s;
	}
	#outerOrbitGroup:hover {
		animation-play-state: paused;
	}
	#Jupiter {
		cursor: pointer;
		/* transition: 300ms; */
		animation-name: floating2;
		animation-duration: 6s;
		animation-iteration-count: infinite;
		animation-timing-function: ease-in-out;
	}


	/* @keyframes test{
		from {
			transform: rotate(0deg);
			transform-origin: bottom;
		}
		to {
			transform: rotate(360deg);
			transform-origin: bottom;

		}
	} */
	
	@keyframes rotateOrbit{
		from {
			transform-origin: center center;
			transform: rotate(0deg);
		}
		to {
			transform-origin: center center;
			transform: rotate(360deg);
		}
	}

	@keyframes rotateIcon{
		from {
            transform-box:fill-box;
			transform-origin: center;
			transform: rotate(0deg);
		}
		to {
            transform-box:fill-box;
			transform-origin: center;
			transform: rotate(-360deg);
		}
	}


	@keyframes floating {
    0% { transform: translate(0,  -1px); }
    50%  { transform: translate(0, 2px); }
    100%   { transform: translate(0, -1px); }   
	}
	@keyframes floating2 {
    0% { transform: translate(0,  -.3px); }
    50%  { transform: translate(0, .8px); }
    100%   { transform: translate(0, -.3px); }   
	}

</style>